import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable, throwError } from 'rxjs';
import { catchError, retry } from 'rxjs/operators';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  url = 'localhost:'
  port = '4001'
  configUrl = '/projects';
  patternEndPoint ='/:pattern=';
  constructor(private http: HttpClient) { }

  getDataMatching(pattern:String)
  {
    return this.http.get<any>(this.url+this.port+this.configUrl +this.patternEndPoint+pattern);
  }

  getData()
  {
    console.log(this.http.get<any>(this.url+this.port+this.configUrl +this.patternEndPoint));
    return this.http.get<any>(this.url+this.port+this.configUrl);
  }

}
